  return (
    <Router>
      <Route exact path="/" component={Home}>
        {/* <Home /> */}
      </Route>

      <Route path="/login" component={Login}>
        {/* <Login /> */}
      </Route>

      <Route path="/signup" component={SignupForm}>
        {/* <SignupForm /> */}
      </Route>
    </Router>
  );
};

export default App;
